                    taskYvals(:,n,y,x,i) = interp1(1:1:size_score_task(n,x,i), score_task(1:size_score_task(n,x,i),y,n,x,i), linspace(1,size_score_task(n,x,i),50));
                else
                    taskYvals(:,n,y,x,i) = NaN;          
                end
            end
        end
    end
    sprintf('%d',i)
end